import img22 from '../../assets/images/img22.png';

export default function DesarrollowebPage() {
  return (
    <div className="container-fuid my-3">
      <div className="container">
        <div className="row">
          <p className="titulo2"></p>
          <div className="col">
            <p className="texto1"></p>
          </div>
          <div className="col">
            <img src={img2} alt="img" className="img-fluid" width="150" />
          </div>
        </div>
      </div>
    </div>
  );
}
